import { positions } from "@mui/system";
import React, { useEffect, useState } from "react";
import  "./weather.scss";

const WeatherData  = (props) =>
{

    useEffect(async ()=>{
        const response = await fetch(`https://api.openweathermap.org/data/2.5/weather?q=${props.city}&appid=9e4cdd6c628c4cbdcacc25b6df594009`);
        const result = response.json();
        console.log(result.main);
    },[props])

    return(
        <>
            <div className="citi_info_wrapper">
                <div className="crnt_city flex-center">
                        <i className="fa-solid fa-location-dot"></i>
                    <h1> {props.city} </h1>
                </div>
                <div className="crnt_city_temp flex-center">
                    <p> crnt Temp </p>
                </div>
            </div>
        </>
    )
}

export default WeatherData;
